// src/App.js
import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Login from './components/Auth/Login';
import Register from './components/Auth/Register';
import Home from './pages/Home'; // Asegúrate de que Home.js existe en src/pages/Home.js
import DocumentList from './components/Documents/DocumentList'; // Ruta ajustada
import DocumentUpload from './components/DocumentUpload'; // Ruta ajustada

function App() {
  return (
    <Routes>
      <Route path="/login" element={<Login />} />
      <Route path="/register" element={<Register />} />
      <Route path="/" element={<Home />} />
      <Route path="/documents" element={<DocumentList />} />
      <Route path="/upload" element={<DocumentUpload />} />
    </Routes>
  );
}

export default App;
